import React from "react";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Slider from './Slider'
import { useTheme } from '@mui/material/styles';
import OutlinedInput from '@mui/material/OutlinedInput';
import Button from '@mui/material/Button';
import { Select, MenuItem, FormControl, InputLabel, makeStyles } from '@material-ui/core';


const useStyles = makeStyles(theme => ({
    FormControl: {
        // minWidth: 200
    }
}));





const Home = () => {
    const classes = useStyles();
    const [Community, setCommunity] = React.useState('');
    const [Type, setType] = React.useState('');
    const [Price, setPrice] = React.useState('');
    // const handleChange = (event) => { setPrice(event.target.value); };

    const theme = useTheme();
  const [personName, setPersonName] = React.useState([]);

  const ITEM_HEIGHT = 48;
const ITEM_PADDING_TOP = 8;
const MenuProps = {
  PaperProps: {
    style: {
      maxHeight: ITEM_HEIGHT * 4.5 + ITEM_PADDING_TOP,
      width: 250,
    },
  },
};

const names = [
  'Oliver Hansen',
  'Van Henry',
  'April Tucker',
  'Ralph Hubbard',
  'Omar Alexander',
  'Carlos Abbott',
  'Miriam Wagner',
  'Bradley Wilkerson',
  'Virginia Andrews',
  'Kelly Snyder',
];

function getStyles(name, personName, theme) {
  return {
    fontWeight:
      personName.indexOf(name) === -1
        ? theme.typography.fontWeightRegular
        : theme.typography.fontWeightMedium,
  };
}

  const handleChange = (event) => {
    const {
      target: { value },
    } = event;
    setPersonName(
      // On autofill we get a stringified value.
      typeof value === 'string' ? value.split(',') : value,
    );
  };
    return (
        <div id="home">
            <Slider />
            <div className="filterss">
                <div className="sele">
                    <FormControl fullWidth>
                        <InputLabel id="demo-simple-select-label1">Community</InputLabel>
                        <Select labelId="demo-simple-select-label1" id="demo-simple-select1" value={Community} label="COMMUNITY" autoWidth onChange={handleChange} >
                            <MenuItem value={10}>1</MenuItem>
                            <MenuItem value={20}>2</MenuItem>
                            <MenuItem value={30}>3</MenuItem>
                        </Select>
                    </FormControl>
                </div>
                <div className="sele">
                    <FormControl sx={{ m: 1, width: 300 }}>
                        <InputLabel id="demo-multiple-name-label">Name</InputLabel>
                        <Select
                            labelId="demo-multiple-name-label"
                            id="demo-multiple-name"
                            multiple
                            value={personName}
                            onChange={handleChange}
                            input={<OutlinedInput label="Name" />}
                            MenuProps={MenuProps}
                        >
                            {names.map((name) => (
                                <MenuItem
                                    key={name}
                                    value={name}
                                    style={getStyles(name, personName, theme)}
                                >
                                    {name}
                                </MenuItem>
                            ))}
                        </Select>
                    </FormControl>
                </div>
                <div className="sele">
                    <FormControl fullWidth >
                        <InputLabel id="demo-simple-select-label3">Price</InputLabel>
                        <Select labelId="demo-simple-select-label3" id="demo-simple-select3" value={Price} label="Price" onChange={handleChange} >
                            <MenuItem value={10}>1</MenuItem>
                            <MenuItem value={20}>2</MenuItem>
                            <MenuItem value={30}>3</MenuItem>
                        </Select>
                    </FormControl>
                </div>
                <div className="sele">
                    <Button variant="contained" >
                        Search Properties
                    </Button>
                </div>

            </div>
        </div>
    )

}
export default Home;
